import React from 'react';
import burgerMenu from '../../assets/images/';
import styles from './Menu.module.css';

const menu = (props) => (
    //using inner css style height here for purpose of  overriding logo main css and the toolbar height settings.using double braces
    <div className={styles.menu}  onClick={props.clicked}>
        <img src={burgerMenu} alt="Burger Logo" />
    </div>

)




export default menu;
